import axios from "axios";

export default {
    state: {
        products: [],
    },
    getters: {
        products: (state) => state.products,
    },
    mutations: {},
    actions: {
        getProducts: async({ commit }) => {
            const res = await axios.get("/api/products/");
            commit("SET_PRODUCTS", res.data);
        },
    },
};
